pragma solidity ^0.6.1;

import "./Accessible.sol";

contract Crowdfounding is Accessible{

    struct Data {
        bool _isOpen;
        uint _target;
        uint _collected;
    }

    mapping(uint => Data) public items;

    function createDonation (uint _id, uint _target) public onlyOwner {
        items[_id]._isOpen = true;
        items[_id]._target = _target;
    }

    function updateDonation (uint _id, uint _target) public onlyOwner {
        items[_id]._target = _target;
    }

    function closeDonation (uint _id) public onlyOwner {
        items[_id]._isOpen = false;
    }

    function donate(uint _id) public payable {
        require(items[_id]._isOpen, "Donation is closed");
        require(items[_id]._collected < items[_id]._target, "Donation have reached target");

        items[_id]._collected += msg.value;
    }

    function sendFunds(uint _id, address payable _to) public payable onlyOwner {
        _to.transfer(items[_id]._collected * 95 /100);
    }

}
